import { doPostAsync, doGetAsync} from "../api";
import {ip, tomcatPort} from "../../misc/constants"; //kanskje ikke nødvendig?

/**
 * @author Sven
 * Klassen skal returnere status på lader
 * @deprecated
 *
 * @param {string} chargerId ID til lader
 * @param callback
 * @returns {Promise<void>}
 */

const getChargerState = (chargerId) => {
    return doPostAsync(`http://${ip}:${tomcatPort}/OperatingMode`,
        {chargerID: chargerId.toString()}, {"Content-Type": "text/plain"});
}

export { getChargerState }
